  input: '"TEXT","F3XN","C00099259","No expenditure was made on behalf of a specifically
    identified federal candidate.  No expenditure was for a public communication that
    referred to a clearly identified candidate for Federal office and that promoted,
    supported, attacked or opposed any such candidate for Federal office. All disbursements
    for salaries and benefits disclosed on Schedule H4 are for employees who did not
    spend more than 25% of their compensated time during the month on Federal election
    activities or activities in connection with a Federal election. The individual
    to whom disbursements were made for software consulting is not an employee of
    the committee. Due to a committee misunderstanding of the requirements for joint
    activity in-kind contributions, the required transfer did not occur until October
    20, 2006.  The transfer made on that date is $6,337.73 and represents the federal
    portion of all joint activity in-kind contributions for the month of September.
    During the period beginning with receipt of the joint activity in-kinds and prior
    to the transfer for them, an amount far in excess of that was due to the federal
    account for monetary non-federal joint activity during the period. As a result,
    at all times the federal account had less funds than actually available for federal
    purposes."'
